    "script": "\tDROP DATABASE IF EXISTS ps3107; CREATE DATABASE ps3107;\n\tCREATE TABLE ps3107.dbo.ps5609\n\t(\n\t\t\t//Define schema of table\n\t\t\tUserId          int, \n\t\t\tStart           DateTime, \n\t\t\tRegion          string, \n\t\t\tQuery           string, \n\t\t\tDuration        int, \n\t\t\tUrls            string, \n\t\t\tClickedUrls     string,\n\t\tINDEX idx1 //Name of index\n\t\tCLUSTERED (Region ASC) //Column to cluster by\n\t\tPARTITIONED BY (UserId) HASH (Region) //Column to partition by\n\t);\n\tALTER TABLE ps3107.dbo.ps5609 ADD IF NOT EXISTS PARTITION (1);\n\tDROP FUNCTION IF EXISTS ps3107.dbo.ps1803;\n\n\t//create table weblogs on space-delimited website log data\n\tCREATE FUNCTION ps3107.dbo.ps1803()\n\tRETURNS @result TABLE\n\t(\n\t\ts_date DateTime,\n\t\ts_time string,\n\t\ts_sitename string,\n\t\tcs_method string, \n\t\tcs_uristem string,\n\t\tcs_uriquery string,\n\t\ts_port int,\n\t\tcs_username string, \n\t\tc_ip string,\n\t\tcs_useragent string,\n\t\tcs_cookie string,\n\t\tcs_referer string, \n\t\tcs_host string,\n\t\tsc_status int,\n\t\tsc_substatus int,\n\t\tsc_win32status int, \n\t\tsc_bytes int,\n\t\tcs_bytes int,\n\t\ts_timetaken int\n\t)\n\tAS\n\tBEGIN\n\n\t\t@result = EXTRACT\n\t\t\ts_date DateTime,\n\t\t\ts_time string,\n\t\t\ts_sitename string,\n\t\t\tcs_method string,\n\t\t\tcs_uristem string,\n\t\t\tcs_uriquery string,\n\t\t\ts_port int,\n\t\t\tcs_username string,\n\t\t\tc_ip string,\n\t\t\tcs_useragent string,\n\t\t\tcs_cookie string,\n\t\t\tcs_referer string,\n\t\t\tcs_host string,\n\t\t\tsc_status int,\n\t\t\tsc_substatus int,\n\t\t\tsc_win32status int,\n\t\t\tsc_bytes int,\n\t\t\tcs_bytes int,\n\t\t\ts_timetaken int\n\t\tFROM @\"/Samples/Data/WebLog.log\"\n\t\tUSING Extractors.Text(delimiter:' ');\n\n\tRETURN;\n\tEND;\n\tCREATE VIEW ps3107.dbo.ps3712 \n\tAS \n\t\tSELECT * FROM \n\t\t(\n\t\t\tVALUES(1,2),(2,4)\n\t\t) \n\tAS \n\tT(a, b);\n\tCREATE PROCEDURE ps3107.dbo.ps6050()\n\tAS BEGIN\n\t  CREATE VIEW ps3107.dbo.ps3712 \n\t  AS \n\t\tSELECT * FROM \n\t\t(\n\t\t\tVALUES(1,2),(2,4)\n\t\t) \n\t  AS \n\t  T(a, b);\n\tEND;",
